import Exp from './components/ExpenseItem'
import './index.css';
function App() {

  const expenseArray = [
    { id : 1, title : "Car Insurance", amount : 456.4, date : new Date()},
    { id : 2, title : "Fridge", amount : 4565.4, date : new Date()},
    { id : 3, title : "Groceries", amount : 46.4, date : new Date()},
    { id : 4, title : "Clothes", amount : 1456.4, date : new Date()}
  ]

  return (
    // this is the end state of the application that I want to see this
    <div className="expenses">
      <Exp expense={expenseArray[0]}></Exp>
      <Exp expense={expenseArray[1]}></Exp>
      <Exp expense={expenseArray[2]}></Exp>
      <Exp expense={expenseArray[3]}></Exp>
    </div>

  );
}

export default App;
